window.bookSummaryJSON = "<p>From the bestselling LitRPG author of The RPG Apocalypse</p> <p>A gas station clerk at twenty-seven with no future prospects on the horizon, Mike Reynolds is a dropout with an addiction to video games and a less-than-ideal living situation. Life definitely isn't great, but could it really get much worse?</p> <p>When monsters appear on Earth and begin destroying the fabric holding together humanity, that thought is thrown out the window: everything is getting worse, and fast. 'Is my world becoming an MMRPG Apocalypse?' Can Mike make good on his prior experience and carve a foothold for himself as a Necromancer in this RPG world?</p>"; 
